import React from "react";

const Activity = ({ name, duration, dificulty, season }) => {
  return (
    <div className="Activity_Container">
      <h1>{name}</h1>
      <h3>Duration: {duration} hs.</h3>
      <h3>Dificulty: {dificulty}</h3>
      <h3>Season: {season}</h3>
    </div>
  );
};

export default Activity;
